import React, {useEffect, useState} from 'react';
import './App.css';

const App= ()=> {

  const [data, setData]=useState({})

  useEffect(()=>{
    fetch("https://api.openbrewerydb.org/breweries")
    .then(req =>req.json())
    .then(data => setData({data}))
  },[])

  return (

    <div className="App">
      {console.log(data)}
    </div>
  );
}

export default App;
